import React, { useState,useEffect } from "react";
import { BrowserRouter} from "react-router-dom";
import AppRoutes from "./components/AppRoutes";
import MenuBar from "./components/MenuBar";
import  {LoggedUserContext,defaultLoggedUser}  from "./context/LoggedUserContext";

function App() {
  const [loggedUser, setLoggedUser] = useState({
    defaultLoggedUser
  });
  const { setLoggedUser: contextSetLoggedUser } = useContext(LoggedUserContext);

  useEffect(() => {
    contextSetLoggedUser(loggedUser); // Update the context when logged user changes
  }, [loggedUser]);

  return (
      <BrowserRouter>
       <LoggedUserContext.Provider
            value={{
              loggedUser,
              setLoggedUser,
            }}
          >
        <MenuBar 
        isLoggedIn={loggedUser.id===""?false:true}/>
        <AppRoutes/>
      </LoggedUserContext.Provider>
      </BrowserRouter>
  );
}

export default App;
